import React, { useState } from 'react';
import Calendar from 'react-calendar';


export default class Calender extends React.Component {
    render() {
        const [value, onChange] = useState(new Date());

        return (
            <div>
                         <Calendar
                                onChange={onChange}
                                value={value}
                            />
          </div>
        )
    }
}
